import React from "react";
import "../css/card.css";
import "../css/style.css";

export default class OpenResponseForm extends React.Component {
    render() {
       return (
         <div className="open_response_form white_wrap">
            <div className="price">
               <div>Цена:</div>
               <div>
                 <input>
                 </input>  
               </div>
               <div className="description">
                 <div>Описание:</div>
                 <div>ИНПУТ</div>
               </div>
               <div className="foto">
                 <div>Фото:</div>
                 <div>ИНПУТ</div>
               </div>
            </div>
         </div>
       );
    }
}
